import React from 'react'
import './styles/Page.css';
import TeamDL from '../Assets/images/Команда DocLab.svg';

function Teamdoclab() {
  return (
    <div className='abut-container'>
    <img
      src={TeamDL} 
    />
</div>
  )
}

export default Teamdoclab
